While there have been no confirmed reports of the Coronavirus Disease 2019 (COVID-19) in Ohio, we are proactively following best practices for prevention within our schools. And, you can help by following these tips as recommended by the Centers for Disease Control and Prevention (CDC):

üîπAvoid close contact with people who are sick;
üîπAvoid touching your nose, eyes, and mouth;
